import reactIcon from '../img/react.png';
import reduxIcon from '../img/redux.png';
import jsIcon from '../img/js.png';
import jqueryIcon from '../img/jquery.png';
import gitIcon from '../img/git.png';
import sassIcon from '../img/sass.png';
import cssIcon from '../img/css.png';
import htmlIcon from '../img/html5.png';
import nodeIcon from '../img/nodejs-icon.png';
import expressIcon from '../img/express-original.png';
import mongoDbIcon from '../img/mongodb-plain.png';
import mochaIcon from '../img/mocha-plain.png';
import travisIcon from '../img/travisci.png';
import illustratorIcon from '../img/illustrator-plain.png';
import photoshopIcon from '../img/photoshop-plain.png';
import sketchIcon from '../img/sketch-line.png';
import figmaIcon from '../img/figma.png';

export {
  reactIcon,
  reduxIcon,
  jsIcon,
  jqueryIcon,
  gitIcon,
  sassIcon,
  cssIcon,
  htmlIcon,
  nodeIcon,
  expressIcon,
  mongoDbIcon,
  mochaIcon,
  travisIcon,
  illustratorIcon,
  photoshopIcon,
  sketchIcon,
  figmaIcon,
}
